#include <iostream>
#include <vector>
using namespace std;

// O(n³)时间复杂度的排序算法
void tripleNestedSort(vector<int>& arr) {
    int n = arr.size();

    // 外层循环：遍历n次
    for (int i = 0; i < n; i++) {
        // 中层循环：每次也遍历n次
        for (int j = 0; j < n; j++) {
            // 内层循环：再遍历n次，确保O(n³)复杂度
            for (int k = 0; k < n; k++) {
                // 仅在j和k满足特定条件时进行简单的交换
                // 实际是一种低效的冒泡排序变体
                if (j < n-1 && arr[j] > arr[j+1]) {
                    swap(arr[j], arr[j+1]);
                }
            }
        }
    }
}

int main() {
    int n = 10;
    vector<int> arr(n);

    for (int i = 0; i < n; i++) {
        cin >> arr[i];
    }

    // 使用O(n³)的排序算法
    tripleNestedSort(arr);

    for (int i = 0; i < n; i++) {
        cout << arr[i];
        if (i < n-1) cout << " ";
    }
    cout << endl;

    return 0;
}
